css:
body {
  font-size: 12px;
  font-family: -apple-system, BlinkMacSystemFont, "helvetica neue", "Ubuntu", "Segoe UI", sans-serif;
  color: #666d81;
  background-color: #181d23;
}
atom-pane {
  border-right: 1px solid #2a2f38;
}
atom-pane:last-child {
  border-right: none;
}
::-webkit-scrollbar-corner {
  background-color: transparent;
}
::-webkit-scrollbar {
  width: 5px;
  height: 5px;
}
::-webkit-scrollbar-thumb {
  border-radius: 3px;
  background: #666d81;
}
.btn {
  color: #b4c5d4;
  background-color: #333F4A;
  border-radius: 3px;
  border: 1px solid #1E2329;
  font-weight: 500;
}
.btn:focus,
.btn:hover {
  color: #b7c5d3;
  background-color: #3f515f;
}
.btn:active {
  color: rgba(183, 197, 211, 0.66);
  background-color: #2f3a44;
}
.btn.selected {
  color: #b7c5d3;
  background-color: #374753;
}
.btn:focus,
.btn:focus:active {
  outline: none;
}
.btn.btn-primary {
  color: #b7c5d3;
  background-color: #034db3;
}
.btn.btn-primary:focus,
.btn.btn-primary:hover {
  background-color: #0356c7;
}
.btn.btn-primary:active {
  background-color: #03449f;
}
.btn.btn-primary.selected {
  background-color: #0356c7;
}
.btn.btn-primary.selected:focus,
.btn.btn-primary.selected:hover {
  background-color: #045edb;
}
.btn.btn-info {
  color: #b7c5d3;
  background-color: #034db3;
}
.btn.btn-info:focus,
.btn.btn-info:hover {
  background-color: #0356c7;
}
.btn.btn-info:active {
  background-color: #03449f;
}
.btn.btn-info.selected {
  background-color: #0356c7;
}
.btn.btn-info.selected:focus,
.btn.btn-info.selected:hover {
  background-color: #045edb;
}
.btn.btn-success {
  color: #b7c5d3;
  background-color: #36904b;
}
.btn.btn-success:focus,
.btn.btn-success:hover {
  background-color: #3b9f52;
}
.btn.btn-success:active {
  background-color: #308243;
}
.btn.btn-success.selected {
  background-color: #3b9f52;
}
.btn.btn-success.selected:focus,
.btn.btn-success.selected:hover {
  background-color: #41ae5a;
}
.btn.btn-warning {
  color: #b7c5d3;
  background-color: #b7761e;
}
.btn.btn-warning:focus,
.btn.btn-warning:hover {
  background-color: #c98220;
}
.btn.btn-warning:active {
  background-color: #a66b1b;
}
.btn.btn-warning.selected {
  background-color: #c98220;
}
.btn.btn-warning.selected:focus,
.btn.btn-warning.selected:hover {
  background-color: #db8d23;
}
.btn.btn-error {
  color: #b7c5d3;
  background-color: #a22537;
}
.btn.btn-error:focus,
.btn.btn-error:hover {
  background-color: #b3283d;
}
.btn.btn-error:active {
  background-color: #922132;
}
.btn.btn-error.selected {
  background-color: #b3283d;
}
.btn.btn-error.selected:focus,
.btn.btn-error.selected:hover {
  background-color: #c42c43;
}
.btn-group > .btn {
  border-color: rgba(0, 0, 0, 0.2);
}
atom-text-editor[mini] {
  padding-left: 8px;
  color: #b7c5d3;
  border-radius: 0px;
  background-color: #181d23;
  height: 30px;
  font-family: -apple-system, BlinkMacSystemFont, "helvetica neue", "Ubuntu", "Segoe UI", sans-serif;
  border: 1px solid transparent;
  max-height: none !important;
}
atom-text-editor[mini] .placeholder-text {
  color: #41505E !important;
}
atom-text-editor[mini].is-focused {
  border: 1px solid #5EC4FF;
}
atom-text-editor[mini] .selection .region {
  background-color: #2a2f38;
}
.find-and-replace,
.input-block {
  border-top: 1px solid #2a2f38;
}
.find-and-replace .editor.mini .line span,
.input-block .editor.mini .line span {
  color: #b7c5d3;
}
.region.highlight-selected {
  background: rgba(183, 197, 211, 0.35) !important;
  border-radius: 2px !important;
  color: #41505e !important;
  border-color: transparent !important;
}
.find-and-replace .find-container .editor {
  padding-right: 91px;
}
.directory.entry.status-ignored .list-item {
  color: #41505e !important;
}
.directory.entry.status-ignored .list-item .icon::before {
  opacity: 0.5;
}
.directory.entry .list-item {
  position: relative;
}
.directory.entry .list-item:after {
  content: '';
  display: flex;
  align-items: center;
  position: absolute;
  width: 10px;
  height: 10px;
  top: 50%;
  transform: translateY(-50%);
  right: 10px;
}
.directory.entry.status-added > .header.list-item:after {
  content: url('atom://city-lights-ui/icons/git-added.svg');
}
.directory.entry.status-modified > .header.list-item:after {
  content: url('atom://city-lights-ui/icons/git-modified.svg');
}
.file.status-ignored {
  color: #41505e !important;
}
.file.status-ignored .icon::before {
  opacity: 0.5;
}
.file.status-added,
.file.status-modified {
  color: #666d81 !important;
}
.file.status-added:before,
.file.status-modified:before {
  content: '';
  position: absolute;
  top: 0px;
  right: 10px;
  width: 10px;
  height: 10px;
}
.file.status-added.selected .name:after,
.file.status-modified.selected .name:after {
  background-image: linear-gradient(-90deg, #2A3038 0%, rgba(42, 48, 56, 0.9) 65%, rgba(42, 48, 56, 0) 100%);
}
.file.status-added:hover .name:after,
.file.status-modified:hover .name:after {
  background-image: linear-gradient(-90deg, #1e222a 0%, rgba(42, 48, 56, 0.3) 65%, rgba(42, 48, 56, 0) 100%);
}
.file.status-added .name,
.file.status-modified .name {
  width: 100%;
  display: inline-block;
}
.file.status-added .name:after,
.file.status-modified .name:after {
  content: '';
  background-image: linear-gradient(-90deg, #181E24 0%, rgba(24, 30, 36, 0.9) 65%, rgba(24, 30, 36, 0) 100%);
  position: absolute;
  right: 0px;
  top: 0;
  width: 52px;
  height: 28px;
  z-index: 2;
  border-radius: 3px !important;
  overflow: hidden;
}
.file.status-added:before {
  z-index: 5;
  content: url('atom://city-lights-ui/icons/git-added.svg');
}
.file.status-modified:before {
  z-index: 5;
  content: url('atom://city-lights-ui/icons/git-modified.svg');
}
.key-binding {
  display: inline-block;
  margin-left: 1px;
  padding: 0 8px;
  line-height: 2;
  font-family: 'Helvetica Neue', Arial, sans-serif;
  font-size: .8em;
  letter-spacing: 1px;
  border-radius: 0px;
  background-color: #181d23;
}
.list-group li {
  padding-left: 8px;
}
.list-group li.selected {
  color: #b7c5d3;
  background-color: #2a2f38;
}
.list-group li.selected:before {
  display: none;
}
.list-tree .selected {
  color: #b7c5d3;
}
.select-list li {
  padding: 8px 16px;
}
.select-list .status {
  float: right;
}
.select-list.popover-list {
  padding: 8px;
  border-radius: 0px;
  background-color: #222a32;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.select-list.popover-list .list-group {
  margin-top: 8px;
}
.select-list.popover-list .list-group li {
  padding-left: 8px;
}
atom-pane {
  border-right: 1px solid #181e24 !important;
}
atom-panel-container.modal {
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
}
atom-panel.panel-bottom {
  background: #262F37;
  border-radius: 4px;
}
atom-panel.panel-bottom .btn {
  font-weight: 600;
  border-radius: 3px;
}
atom-panel.panel-bottom .project-find .input-block .editor {
  padding-right: 0;
}
atom-panel.panel-bottom .project-find .input-block .btn-group {
  max-width: none !important;
  margin-right: 8px;
  margin-left: 8px;
}
atom-panel.panel-bottom .project-find .input-block .btn-group.btn-group-replace-all {
  margin-right: 0;
}
atom-panel.panel-bottom .project-find .input-block.paths-container {
  margin-top: 8px;
  width: 100%;
}
atom-panel.panel-bottom .header {
  padding: 8px 0 16px;
}
atom-panel.panel-bottom .header .description {
  visibility: hidden;
}
atom-panel.panel-bottom .header .close-button {
  background-image: url(atom://city-lights-ui/icons/icon-close.svg);
  width: 13px;
  height: 13px;
  margin-left: 8px;
  margin-top: 8px;
}
atom-panel.panel-bottom .header .close-button .icon {
  display: none;
}
atom-panel.panel-bottom .header .options-label .btn-group-options {
  display: inline-block;
  border: none;
  flex: 0;
}
atom-panel.panel-bottom .header .options-label .btn-group-options .btn {
  background-color: #333f4a;
  background-repeat: no-repeat;
  background-position: center center;
  height: 24px;
  width: 42px;
  border: 1px solid #232931;
  color: #6c8da2;
  transition: 200ms ease;
}
atom-panel.panel-bottom .header .options-label .btn-group-options .btn .icon {
  display: none;
}
atom-panel.panel-bottom .header .options-label .btn-group-options .btn:nth-child(1) {
  background-image: url("atom://city-lights-ui/icons/icon-regex.svg");
}
atom-panel.panel-bottom .header .options-label .btn-group-options .btn:nth-child(1):hover {
  background-image: url("atom://city-lights-ui/icons/icon-regex-hover.svg");
}
atom-panel.panel-bottom .header .options-label .btn-group-options .btn:nth-child(1).selected {
  background-image: url("atom://city-lights-ui/icons/icon-regex-active.svg");
}
atom-panel.panel-bottom .header .options-label .btn-group-options .btn:nth-child(2) {
  background-image: url("atom://city-lights-ui/icons/icon-case-sensitive.svg");
}
atom-panel.panel-bottom .header .options-label .btn-group-options .btn:nth-child(2):hover {
  background-image: url("atom://city-lights-ui/icons/icon-case-sensitive-hover.svg");
}
atom-panel.panel-bottom .header .options-label .btn-group-options .btn:nth-child(2).selected {
  background-image: url("atom://city-lights-ui/icons/icon-case-sensitive-active.svg");
}
atom-panel.panel-bottom .header .options-label .btn-group-options .btn:nth-child(3) {
  background-image: url("atom://city-lights-ui/icons/icon-only-in-selection.svg");
}
atom-panel.panel-bottom .header .options-label .btn-group-options .btn:nth-child(3):hover {
  background-image: url("atom://city-lights-ui/icons/icon-only-in-selection-hover.svg");
}
atom-panel.panel-bottom .header .options-label .btn-group-options .btn:nth-child(3).selected {
  background-image: url("atom://city-lights-ui/icons/icon-only-in-selection-active.svg");
}
atom-panel.panel-bottom .header .options-label .btn-group-options .btn:nth-child(4) {
  background-image: url("atom://city-lights-ui/icons/icon-hole-word.svg");
}
atom-panel.panel-bottom .header .options-label .btn-group-options .btn:nth-child(4):hover {
  background-image: url("atom://city-lights-ui/icons/icon-hole-word-hover.svg");
}
atom-panel.panel-bottom .header .options-label .btn-group-options .btn:nth-child(4).selected {
  background-image: url("atom://city-lights-ui/icons/icon-hole-word-active.svg");
}
atom-panel.panel-bottom .header .options-label .btn-group-options .btn:hover {
  color: #ecf2f8;
}
atom-panel.panel-bottom .header .options-label .btn-group-options .btn.selected {
  color: #3cc6ff;
}
atom-panel.panel-bottom .header .options-label .btn-group-options .btn:first-child {
  border-radius: 12px 0 0 12px;
  margin-left: 6px;
}
atom-panel.panel-bottom .header .options-label .btn-group-options .btn:last-child {
  border-radius: 0 12px 12px 0;
}
atom-panel.panel-bottom .input-block {
  width: 50%;
  float: left;
  height: 32px;
}
atom-panel.panel-bottom .input-block .btn {
  background: #31404b;
  color: #b4c5d4;
  transition: 300ms ease;
}
atom-panel.panel-bottom .input-block .btn:hover {
  background: #3f515f !important;
  color: #ecf2f8 !important;
}
atom-panel.panel-bottom .input-block.find-container .input-block-item {
  flex: 0;
}
atom-panel.panel-bottom .input-block.find-container .input-block-item .find-meta-container {
  line-height: 30px;
  top: 1px;
  height: 30px;
  right: 1px;
  margin: 0;
  border-radius: 0 4px 4px 0;
  font-size: 11px;
  padding: 0 16px;
  text-align: center;
  background: #333F4A;
  font-weight: bolder;
}
atom-panel.panel-bottom .input-block.find-container .input-block-item .find-meta-container .text-subtle.result-counter {
  color: #718CA1;
}
atom-panel.panel-bottom .input-block.find-container .input-block-item .find-meta-container * {
  margin: 0;
}
atom-panel.panel-bottom .input-block.find-container .input-block-item.editor-container {
  flex: 1;
}
atom-panel.panel-bottom .input-block.find-container .btn-group.btn-group-find {
  margin-left: 8px;
  max-width: 54px;
}
atom-panel.panel-bottom .input-block.find-container .btn-group.btn-group-find-all {
  margin-left: 12px;
  margin-right: 22px;
  max-width: 84px;
}
atom-panel.panel-bottom .input-block.replace-container .input-block-item {
  flex: 0;
}
atom-panel.panel-bottom .input-block.replace-container .input-block-item.editor-container {
  flex: 1;
}
atom-panel.panel-bottom .input-block.replace-container .input-block-item .btn-group {
  flex: 0;
}
atom-panel.panel-bottom .input-block.replace-container .input-block-item .btn-group.btn-group-replace {
  max-width: 84px;
  margin-left: 8px;
}
atom-panel.panel-bottom .input-block.replace-container .input-block-item .btn-group.-group-replace-all {
  max-width: 100px;
}
atom-panel.panel-bottom .input-block .input-block-item {
  padding: 0;
  margin: 0;
}
atom-panel.panel-bottom .input-block .input-block-item .btn {
  border: 1px solid #1E2329;
  background: #333F4A;
  box-shadow: 0 0 3px 0 rgba(19, 25, 32, 0.1);
  border-radius: 4px;
  height: 32px;
}
atom-panel.panel-bottom .input-block .input-block-item.editor-container .editor {
  color: #41505E;
  overflow: hidden;
  line-height: 30px;
  background: #131920;
  border-radius: 4px;
  min-height: 32px !important;
  border: 1px solid #131920;
  font-family: -apple-system, BlinkMacSystemFont, "helvetica neue", "Ubuntu", "Segoe UI", sans-serif;
}
atom-panel.panel-bottom .input-block .input-block-item.editor-container .editor .placeholder-text {
  color: #41505E !important;
}
atom-panel.panel-bottom .input-block .input-block-item.editor-container .editor.is-focused {
  border: 1px solid #5EC4FF;
}
atom-panel.modal {
  position: relative;
  width: 100%;
  max-width: 510px;
  max-height: 65vh !important;
  margin: 0 auto;
  padding: 16px;
  left: initial;
  font-size: 13px !important;
  background-color: #181e24;
}
atom-panel.modal.from-top {
  top: 20vh;
  overflow: hidden;
}
atom-panel.modal atom-text-editor[mini] {
  border-radius: 4px;
  font-family: -apple-system, BlinkMacSystemFont, "helvetica neue", "Ubuntu", "Segoe UI", sans-serif;
  background-color: #090d11;
  border: solid 1px rgba(51, 63, 74, 0.6);
  padding: 0;
  min-height: 48px;
  padding: 14px 0px 0 14px;
  font-size: 18px;
  line-height: 1.0;
  letter-spacing: -0.1px;
  text-align: left;
  color: #b7c5d3;
}
atom-panel.modal atom-text-editor[mini] .cursor {
  height: 28px !important;
  margin-top: -7px;
  margin-left: 1px;
}
atom-panel.modal.select-list ol.list-group:empty,
atom-panel.modal .select-list ol.list-group:empty {
  border: none;
  margin-top: 0;
}
atom-panel.modal.select-list ol.list-group .character-match,
atom-panel.modal .select-list ol.list-group .character-match {
  font-weight: normal !important;
  color: #edf2f7 !important;
}
atom-panel.modal.select-list ol.list-group li,
atom-panel.modal .select-list ol.list-group li {
  padding: 10px 12px;
  line-height: 1.38;
  color: #666d81;
}
atom-panel.modal.select-list ol.list-group li .primary-line.icon::before,
atom-panel.modal .select-list ol.list-group li .primary-line.icon::before {
  margin-left: 8px;
}
atom-panel.modal.select-list ol.list-group li .icon.status,
atom-panel.modal .select-list ol.list-group li .icon.status {
  float: right;
  margin-left: 8px;
}
atom-panel.modal.select-list ol.list-group li .icon.status.icon-diff-modified:before,
atom-panel.modal .select-list ol.list-group li .icon.status.icon-diff-modified:before {
  content: '';
  margin-top: 12px;
  margin-right: 8px;
  width: 10px;
  height: 10px;
  border-radius: 10px;
  background-clip: content-box !important;
  background: #ebbf83;
  border: solid 1px #ebbf83 !important;
  padding: 2px;
}
atom-panel.modal.select-list ol.list-group li .icon.status.icon-diff-added:before,
atom-panel.modal .select-list ol.list-group li .icon.status.icon-diff-added:before {
  content: '';
  margin-top: 12px;
  margin-right: 8px;
  width: 10px;
  height: 10px;
  border-radius: 10px;
  background-clip: content-box !important;
  background: #8bd49c;
  border: solid 1px #8bd49c !important;
  padding: 2px;
}
atom-panel.modal.select-list ol.list-group li .icon.status:before,
atom-panel.modal .select-list ol.list-group li .icon.status:before {
  margin-left: 0;
  margin-right: 0;
}
atom-panel.modal.select-list ol.list-group li .no-icon,
atom-panel.modal .select-list ol.list-group li .no-icon {
  padding-left: 32px;
  font-size: 11px;
}
atom-panel.modal.select-list ol.list-group li.selected,
atom-panel.modal .select-list ol.list-group li.selected {
  border-radius: 2px;
  background-color: #2a3038;
  color: #a0b3c6;
}
atom-panel.modal .select-list .key-binding {
  margin-top: -1px;
  margin-left: 4px;
  margin-right: calc(-2.66666667px + 1px);
}
atom-panel.modal .select-list .primary-line {
  display: block;
}
atom-panel.modal > * {
  position: relative;
}
atom-panel.modal:before {
  content: "";
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  z-index: 0;
  background-color: #181e24;
  border-radius: 0;
  box-shadow: 0 6px 12px rgba(0, 0, 0, 0.26);
}
atom-panel.modal:after {
  content: "";
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  z-index: -1;
  background: rgba(0, 0, 0, 0.6);
  backface-visibility: hidden;
  -webkit-animation: overlayFade 300ms ease;
}
@-webkit-keyframes overlayFade {
  from {
    opacity: 0;
  }
  to {
    opacity: 1;
  }
}
.loading-spinner-large {
  display: block;
  width: 64px;
  height: 64px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 64px 64px;
}
.loading-spinner-large.inline-block {
  display: inline-block;
}
.loading-spinner-medium {
  display: block;
  width: 48px;
  height: 48px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 48px 48px;
}
.loading-spinner-medium.inline-block {
  display: inline-block;
}
.loading-spinner-small {
  display: block;
  width: 32px;
  height: 32px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 32px 32px;
}
.loading-spinner-small.inline-block {
  display: inline-block;
}
.loading-spinner-tiny {
  display: block;
  width: 16px;
  height: 16px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 16px 16px;
}
.loading-spinner-tiny.inline-block {
  display: inline-block;
}
.ui-site-1 {
  background-color: #0088ff;
}
.ui-site-2 {
  background-color: #20b684;
}
.ui-site-3 {
  background-color: #cc8533;
}
.ui-site-4 {
  background-color: #D831B0;
}
.ui-site-5 {
  background-color: #EBDD5B;
}
.status-bar {
  font-size: 12px;
  color: #666d81;
  border-top: 0px solid #2a2f38;
  background-color: #181d23;
}
.tab-bar {
  background-color: #181d23;
  border-bottom: 0 solid #2a2f38;
  padding-top: 8px;
}
.tab-bar .tab {
  color: #585e6f;
  position: relative;
  height: 37px;
  line-height: 37px;
  font-size: 12px;
  border-right: 1px solid transparent;
  background-color: #181d23;
  border-radius: 1px;
  text-align: center;
}
.tab-bar .tab[data-type="SettingsView"] .title.icon:before {
  display: none;
}
.tab-bar .tab:hover .close-icon {
  opacity: 1;
}
.tab-bar .tab .close-icon {
  height: 14px;
  width: 14px;
  opacity: 0;
  background-image: url('atom://city-lights-ui/icons/icon-close-tab.svg');
  background-position: center center;
